import { Routes, Route } from 'react-router-dom';
import LogIn from '../account/LogIn';


const Account = (props) => {
  return (
    <Routes>
      <div>
        <h3>Account</h3>
      </div>
      <Route path='login' element={<LogIn />} />
    </Routes>

  );
}
export default Account;
